PyMODINIT_FUNC PyInit_multiplier(void) {
  auto m = PyModule_Create(&gModule);
  if (!m) {
    return nullptr;
  }

  for (auto loader : gLoaders) {
    if (!loader(m)) {
      return nullptr;
    }
  }

  return m;
}
